import React from "react";

const LoginLinks = () => {
  const handleSignUp = () => {
    // 회원가입 모달 띄우기 또는 페이지 이동
    alert("회원가입 기능 실행!");
    // 예: navigate("/signup") 또는 모달 상태 변경
  };

  const handleFindId = () => {
    // 아이디 찾기 기능
    alert("아이디 찾기 기능 실행!");
    // 예: 모달 열기 또는 페이지 이동
  };

  const handleFindPassword = () => {
    // 비밀번호 찾기 기능
    alert("비밀번호 찾기 기능 실행!");
    // 예: 모달 열기 또는 페이지 이동
  };

  return (
    <div className="login-links">
      <button className="link-btn" onClick={handleSignUp}>
        회원가입하기
      </button>
      <button className="link-btn" onClick={handleFindId}>
        아이디 찾기
      </button>
      <button className="link-btn" onClick={handleFindPassword}>
        비밀번호 찾기
      </button>
    </div>
  );
};

export default LoginLinks;
